import { StyleSheet } from "react-native";

export default StyleSheet.create({
    input: {
        display: "flex",
        flexDirection: row,
        borderWidth: 1,
        borderColor: 'black'
    },
    page: {
        flex: 1,
        alignItems: 'center',
    },
    btn: {
        borderColor: 'black',
        borderWidth: 2,
    }
})
